import { Button, Typography } from '@mui/material';
import '../App.css';
import './styles/home.css'; 

const HomeText = () => {
	return (
		<div className='home_text_container'>
      <div className='home_text'>
        <p class="header-introduction"> I'm Nelson Rodriguez </p>
        <p class='header-information'>A<strong> Developer </strong> {/**<a class="company">@Meta</a>**/} and
            <a> </a>
            <a class="link-parchment" target="_blank" rel="noopener noreferrer" href="https://www.parchment.com/u/award/cdc63a097762a059103a9b3ce857a15e">CS Alum</a>
            <a> </a>
            <a class="link-gatech" target="_blank" rel="noopener noreferrer" href="https://www.cc.gatech.edu/">
              <strong class="georgia-tech">@Georgia Tech</strong>
            </a> 
        </p>
        <Button variant='text' size='large' onClick='/scrollToAboutMe' color='inherit'>
          <Typography variant='h6' align='center' sx={{fontFamily: 'var(--font-family-ibm-plex-mono)'}}>
            About Me
          </Typography>
        </Button>
      </div>
    </div>
	)
}

export default HomeText;
